import styled from "styled-components";

const StyledTitle = ({ englishTitle }) => {
  return (
    <>
      <Title>{englishTitle}</Title>
    </>
  );
};

export default StyledTitle;

const Title = styled.div`
  color: aliceblue;
  font-size: 18px;
  margin: 2.5%;
  text-align: center;
`;
